import React from "react";

function Home() {
	return (
		<div className="container">
			<h1>Employee Management - CRUD</h1>
			<p>
				<b>Assignment 2</b>: React.js
			</p>
			<p>
				<b>Back-end</b>: Node.js, Express.js
			</p>
			<p>
				<b>Database</b>: MongoDB 
			</p>
		</div>
	);
}

export default Home;
